import React from 'react';
import './App.scss';
import Game from './components/Game';
import { Grid, AppBar, Toolbar, Button } from '@material-ui/core';

function App() {
  return (
    <Grid container>
      <AppBar position="static">
        <Toolbar>
          <Button>Login</Button>
        </Toolbar>
      </AppBar>
      <Grid item xs={12}>
        <Grid container justify="center">
          <Grid item>
            <Game></Game>
          </Grid>
        </Grid>
      </Grid>
    </Grid>
  );
}

export default App;
